"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[8485],{789:(e,t,s)=>{s.r(t),s.d(t,{default:()=>n,johnChapter1ES:()=>o});const o={chapter:1,title:"Jean 1",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"En el principio era el Verbo, y el Verbo era con Dios, y el Verbo era Dios.",strong:[{text:"principio",strong:"G746",start:6,end:15},{text:"Verbo",strong:"G3056",start:23,end:28},{text:"Verbo",strong:"G3056",start:35,end:40},{text:"Dios",strong:"G2316",start:49,end:53},{text:"Verbo",strong:"G3056",start:60,end:65},{text:"Dios",strong:"G2316",start:70,end:74}]},{number:2,text:"Este era en el principio con Dios.",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"principio",strong:"G746",start:15,end:24},{text:"Dios",strong:"G2316",start:29,end:33}]},{number:3,text:"Todas las cosas por \xe9l fueron hechas; y sin \xe9l nada de lo que es hecho, fue hecho.",strong:[{text:"nada",strong:"G3762",start:47,end:51}]},{number:4,text:"En \xe9l estaba la vida, y la vida era la luz de los hombres.",strong:[{text:"vida",strong:"G2222",start:16,end:20},{text:"vida",strong:"G2222",start:27,end:31}]},{number:5,text:"Y la luz en las tinieblas resplandece; mas las tinieblas no la comprendieron.",strong:[{text:"dans",strong:"H6887",start:16,end:20}]},{number:6,text:"Fue un hombre enviado de Dios, el cual se llamaba Juan.",strong:[{text:"hombre",strong:"G444",start:7,end:13},{text:"Dios",strong:"G2316",start:25,end:29},{text:"Juan",strong:"G2491",start:50,end:54}]},{number:7,text:"Este vino por testimonio, para que diese testimonio de la luz, para que todos creyesen por \xe9l.",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"testimonio",strong:"G3141",start:14,end:24},{text:"testimonio",strong:"G3141",start:41,end:51}]},{number:8,text:"No era \xe9l la luz, sino para que diese testimonio de la luz.",strong:[{text:"testimonio",strong:"G3141",start:38,end:48}]},{number:9,text:"Aquel era la luz verdadera, que alumbra \xe1 todo hombre que viene \xe1 este mundo.",strong:[{text:"todo",strong:"G3956",start:42,end:46},{text:"hombre",strong:"G444",start:47,end:53},{text:"este",strong:"G3778",start:66,end:70},{text:"mundo",strong:"G2889",start:71,end:76}]},{number:10,text:"En el mundo estaba, y el mundo fue hecho por \xe9l; y el mundo no le conoci\xf3.",strong:[{text:"mundo",strong:"G2889",start:6,end:11},{text:"mundo",strong:"G2889",start:25,end:30},{text:"mundo",strong:"G2889",start:54,end:59}]},{number:11,text:"A lo suyo vino, y los suyos no le recibieron.",strong:[]},{number:12,text:"Mas \xe1 todos los que le recibieron, di\xf3les potestad de ser hechos hijos de Dios, \xe1 los que creen en su nombre:",strong:[{text:"Dios",strong:"G2316",start:74,end:78},{text:"nombre",strong:"G3686",start:102,end:108}]},{number:13,text:"Los cuales no son engendrados de sangre, ni de voluntad de carne, ni de voluntad de var\xf3n, mas de Dios.",strong:[{text:"carne",strong:"G4561",start:59,end:64},{text:"Dios",strong:"G2316",start:98,end:102}]},{number:14,text:"Y aquel Verbo fue hecho carne, y habit\xf3 entre nosotros (y vimos su gloria, gloria como del unig\xe9nito del Padre), lleno de gracia y de verdad.",strong:[{text:"Verbo",strong:"G3056",start:8,end:13},{text:"carne",strong:"G4561",start:24,end:29},{text:"como",strong:"G2531",start:82,end:86},{text:"Padre",strong:"G3962",start:105,end:110},{text:"verdad",strong:"G225",start:134,end:140}]},{number:15,text:"Juan di\xf3 testimonio de \xe9l, y clam\xf3 diciendo: Este es del que yo dec\xeda: El que viene despu\xe9s de m\xed, es antes de m\xed: porque es primero que yo.",strong:[{text:"Juan",strong:"G2491",start:0,end:4},{text:"testimonio",strong:"G3141",start:9,end:19},{text:"Este",strong:"G3778",start:45,end:49},{text:"primero",strong:"G4413",start:125,end:132}]},{number:16,text:"Porque de su plenitud tomamos todos, y gracia por gracia.",strong:[{text:"plenitud",strong:"G4138",start:13,end:21}]},{number:17,text:"Porque la ley por Mois\xe9s fue dada; mas la gracia y la verdad por Jesucristo fue hecha.",strong:[{text:"verdad",strong:"G225",start:54,end:60}]},{number:18,text:"A Dios nadie le vi\xf3 jam\xe1s: el unig\xe9nito Hijo, que est\xe1 en el seno del Padre, \xe9l le declar\xf3.",strong:[{text:"Dios",strong:"G2316",start:2,end:6},{text:"nadie",strong:"G3762",start:7,end:12},{text:"Hijo",strong:"G5207",start:40,end:44},{text:"Padre",strong:"G3962",start:70,end:75}]},{number:19,text:"Y este es el testimonio de Juan, cuando los Jud\xedos enviaron de Jerusalem sacerdotes y Levitas, que le preguntasen: \xbfT\xfa, qui\xe9n eres?",strong:[{text:"este",strong:"G3778",start:2,end:6},{text:"testimonio",strong:"G3141",start:13,end:23},{text:"Juan",strong:"G2491",start:27,end:31}]},{number:20,text:"Y confes\xf3, y no neg\xf3; mas declar\xf3: No soy yo el Cristo.",strong:[{text:"Cristo",strong:"G5547",start:48,end:54}]},{number:21,text:"Y le preguntaron: \xbfQu\xe9 pues? \xbfEres t\xfa El\xedas? Dijo: No soy. \xbfEres t\xfa el profeta? Y respondi\xf3: No.",strong:[]},{number:22,text:"Dij\xe9ronle: \xbfPues qui\xe9n eres? para que demos respuesta \xe1 los que nos enviaron. \xbfQu\xe9 dices de ti mismo?",strong:[]},{number:23,text:"Dijo: Yo soy la voz del que clama en el desierto: Enderezad el camino del Se\xf1or, como dijo Isa\xedas profeta.",strong:[{text:"desierto",strong:"G2048",start:40,end:48},{text:"camino",strong:"G3598",start:63,end:69},{text:"como",strong:"G2531",start:81,end:85}]},{number:24,text:"Y los que hab\xedan sido enviados eran de los Fariseos.",strong:[]},{number:25,text:"Y pregunt\xe1ronle, y dij\xe9ronle: \xbfPor qu\xe9 pues bautizas, si t\xfa no eres el Cristo, ni El\xedas, ni el profeta?",strong:[{text:"Cristo",strong:"G5547",start:71,end:77}]},{number:26,text:"Y Juan les respondi\xf3, diciendo: Yo bautizo con agua; mas en medio de vosotros ha estado \xe1 quien vosotros no conoc\xe9is.",strong:[{text:"Juan",strong:"G2491",start:2,end:6},{text:"agua",strong:"H4325",start:47,end:51}]},{number:27,text:"Este es el que ha de venir tras m\xed, el cual es antes de m\xed: del cual yo no soy digno de desatar la correa del zapato.",strong:[{text:"Este",strong:"G3778",start:0,end:4}]},{number:28,text:"Estas cosas acontecieron en Bet\xe1bara, de la otra parte del Jord\xe1n, donde Juan bautizaba.",strong:[{text:"Juan",strong:"G2491",start:73,end:77}]},{number:29,text:"El siguiente d\xeda vi\xf3 Juan \xe1 Jes\xfas que ven\xeda \xe1 \xe9l, y dijo: He aqu\xed el Cordero de Dios, que quita el pecado del mundo.",strong:[{text:"Juan",strong:"G2491",start:21,end:25},{text:"Cordero",strong:"G721",start:69,end:76},{text:"Dios",strong:"G2316",start:80,end:84},{text:"mundo",strong:"G2889",start:110,end:115}]},{number:30,text:"Este es del que dije: Tras m\xed viene un var\xf3n, el cual es antes de m\xed: porque era primero que yo.",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"primero",strong:"G4413",start:81,end:88}]},{number:31,text:"Y yo no le conoc\xeda; mas para que fuese manifestado \xe1 Israel, por eso vine yo bautizando con agua.",strong:[{text:"agua",strong:"H4325",start:92,end:96}]},{number:32,text:"Y Juan di\xf3 testimonio, diciendo: Vi al Esp\xedritu que descend\xeda del cielo como paloma, y repos\xf3 sobre \xe9l.",strong:[{text:"Juan",strong:"G2491",start:2,end:6},{text:"testimonio",strong:"G3141",start:11,end:21},{text:"cielo",strong:"H8064",start:66,end:71},{text:"como",strong:"G2531",start:72,end:76}]},{number:33,text:"Y yo no le conoc\xeda; mas el que me envi\xf3 \xe1 bautizar con agua, aqu\xe9l me dijo: Sobre quien vieres descender el Esp\xedritu, y que reposa sobre \xe9l, \xe9ste es el que bautiza con Esp\xedritu Santo.",strong:[{text:"bautizar",strong:"G907",start:42,end:50},{text:"agua",strong:"H4325",start:55,end:59}]},{number:34,text:"Y yo le vi, y he dado testimonio que \xe9ste es el Hijo de Dios.",strong:[{text:"testimonio",strong:"G3141",start:22,end:32},{text:"Hijo",strong:"G5207",start:48,end:52},{text:"Dios",strong:"G2316",start:56,end:60}]},{number:35,text:"El siguiente d\xeda otra vez estaba Juan, y dos de sus disc\xedpulos.",strong:[{text:"Juan",strong:"G2491",start:33,end:37}]},{number:36,text:"Y mirando \xe1 Jes\xfas que andaba por all\xed, dijo: He aqu\xed el Cordero de Dios.",strong:[{text:"Cordero",strong:"G721",start:56,end:63},{text:"Dios",strong:"G2316",start:67,end:71}]},{number:37,text:"Y oy\xe9ronle los dos disc\xedpulos hablar, y siguieron \xe1 Jes\xfas.",strong:[{text:"hablar",strong:"H559",start:30,end:36}]},{number:38,text:"Y volvi\xe9ndose Jes\xfas, y vi\xe9ndolos seguir le, d\xedceles: \xbfQu\xe9 busc\xe1is? Y ellos le dijeron: Rabb\xed (que declarado quiere decir Maestro) \xbfd\xf3nde moras?",strong:[{text:"decir",strong:"H559",start:115,end:120},{text:"Maestro",strong:"G1320",start:121,end:128}]},{number:39,text:"D\xedceles: Venid y ved. Vinieron, y vieron donde moraba, y qued\xe1ronse con \xe9l aquel d\xeda: porque era como la hora de las diez.",strong:[{text:"como",strong:"G2531",start:97,end:101}]},{number:40,text:"Era Andr\xe9s, hermano de Sim\xf3n Pedro, uno de los dos que hab\xedan o\xeddo de Juan, y le hab\xedan seguido.",strong:[{text:"Juan",strong:"G2491",start:70,end:74}]},{number:41,text:"Este hall\xf3 primero \xe1 su hermano Sim\xf3n, y d\xedjole: Hemos hallado al Mes\xedas (que declarado es, el Cristo).",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"primero",strong:"G4413",start:11,end:18},{text:"Cristo",strong:"G5547",start:95,end:101}]},{number:42,text:"Y le trajo \xe1 Jes\xfas. Y mir\xe1ndole Jes\xfas, dijo: T\xfa eres Sim\xf3n, hijo de Jon\xe1s: t\xfa ser\xe1s llamado Cefas (que quiere decir, Piedra).",strong:[{text:"hijo",strong:"G5207",start:60,end:64},{text:"decir",strong:"H559",start:110,end:115}]},{number:43,text:"El siguiente d\xeda quiso Jes\xfas ir \xe1 Galilea, y halla \xe1 Felipe, al cual dijo: S\xedgueme.",strong:[{text:"Felipe",strong:"G5376",start:53,end:59}]},{number:44,text:"Y era Felipe de Bethsaida, la ciudad de Andr\xe9s y de Pedro.",strong:[{text:"Felipe",strong:"G5376",start:6,end:12}]},{number:45,text:"Felipe hall\xf3 \xe1 Natanael, y d\xedcele: Hemos hallado \xe1 aquel de quien escribi\xf3 Mois\xe9s en la ley, y los profetas: \xe1 Jes\xfas, el hijo de Jos\xe9, de Nazaret.",strong:[{text:"Felipe",strong:"G5376",start:0,end:6},{text:"hijo",strong:"G5207",start:121,end:125}]},{number:46,text:"Y d\xedjole Natanael: \xbfDe Nazaret puede haber algo de bueno? D\xedcele Felipe: Ven y ve.",strong:[{text:"bueno",strong:"G2570",start:51,end:56},{text:"Felipe",strong:"G5376",start:65,end:71}]},{number:47,text:"Jes\xfas vi\xf3 venir \xe1 s\xed \xe1 Natanael, y dijo de \xe9l: He aqu\xed un verdadero Israelita, en el cual no hay enga\xf1o.",strong:[{text:"dans",strong:"H6887",start:78,end:82}]},{number:48,text:"D\xedcele Natanael: \xbfDe d\xf3nde me conoces? Respondi\xf3 Jes\xfas, y d\xedjole: Antes que Felipe te llamara, cuando estabas debajo de la higuera te vi.",strong:[{text:"Felipe",strong:"G5376",start:76,end:82}]},{number:49,text:"Respondi\xf3 Natanael, y d\xedjole: Rabb\xed, t\xfa eres el Hijo de Dios; t\xfa eres el Rey de Israel.",strong:[{text:"Hijo",strong:"G5207",start:48,end:52},{text:"Dios",strong:"G2316",start:56,end:60}]},{number:50,text:"Respondi\xf3 Jes\xfas y d\xedjole: \xbfPorque te dije, te vi debajo de la higuera, crees? cosas mayores que \xe9stas ver\xe1s.",strong:[]},{number:51,text:"Y d\xedcele: De cierto, de cierto os digo: De aqu\xed adelante ver\xe9is el cielo abierto, y los \xe1ngeles de Dios que suben y descienden sobre el Hijo del hombre.",strong:[{text:"cielo",strong:"H8064",start:67,end:72},{text:"Dios",strong:"G2316",start:99,end:103},{text:"Hijo",strong:"G5207",start:136,end:140},{text:"hombre",strong:"G444",start:145,end:151}]}]},n=o}}]);
